import React from "react";
import { Dropdown, Item, Label,Image } from "semantic-ui-react";
const items = [
  "My Profile",
  "Configuration Notification",
  "Extensions",
  "Log out",
];
const Profile = () => (
  <Dropdown
  className=" navbarItem"
    icon={
        <Label as='a' image style={{height:'100%'}}>
        <Image size="big" src='https://picsum.photos/40/40' avatar />
        <span style={{height:'100%', fontSize:'15px', fontWeight:'200'}}>Paul Walker</span>
        </Label>
    }
  >
    <Dropdown.Menu>
      {items.map((item, id) => (
        <Dropdown.Item key={item + id}>{item}</Dropdown.Item>
      ))}
    </Dropdown.Menu>
  </Dropdown>
);

export default Profile;
